//Init candle and period
let candle = record.current
let len = 14

//EMA calculations
let ema1 = calculateEMA(len, candle.close, variable.prevEMA1)
variable.prevEMA1 = ema1

let ema2 = calculateEMA(len, ema1, variable.prevEMA2)
variable.prevEMA2 = ema2

// Double EMA
variable.DEMA = 2 * ema1 - ema2

// NaN -> 0 
variable.DEMA = variable.DEMA || 0

// FUNCTION
// EMA calculations
function calculateEMA(periods, price, previousEMA) {
	let k = 2 / (periods + 1)
	return price * k + previousEMA * (1 - k)
}

